import React, { useState } from 'react';
import {
    Button,InputGroup, InputGroupAddon, InputGroupText, Input,
  } from 'reactstrap';
import Navig from './Navig';

export default function Home() {
  const [location, setLocation]= useState('');
  const [destination, setDestination]= useState('');
    var white = {
      color: "white"
    }
    var min = {
      minWidth: '600px'
    }
    return (
      <div className="background">
        <Navig />
        <div className="container">
          <div className="flex">
            <div className="row">
              <h1 className="display-3 text-center" style={white}>FIND A TRIP</h1>
            </div>
            <div className="row">
              <InputGroup style={{marginBottom:"15px",width: "450px"}}>
                <InputGroupAddon addonType="prepend">
                  <InputGroupText>In Between</InputGroupText>
                </InputGroupAddon>
                <Input type="date" />
                <Input type="date" />
              </InputGroup>
            </div>
            <div className="row">
            <InputGroup style={{marginLeft:"15px", width: "300px",marginBottom:"15px"}}>
                <InputGroupAddon addonType="prepend">
                  <InputGroupText>From</InputGroupText>
                </InputGroupAddon>
                <Input placeholder="Your Location" onChange={(e)=>setLocation(e.target.value)} value={location}/>
              </InputGroup>
              <InputGroup style={{marginLeft:"15px",width: "300px", marginBottom:"15px"}}>
                  <InputGroupAddon addonType="prepend">
                    <InputGroupText>To</InputGroupText>
                  </InputGroupAddon>
                  <Input placeholder="Destination" onChange={(e)=>setDestination(e.target.value)} value={destination}/>
              </InputGroup>
              <Button style={{marginLeft:"15px",marginBottom:"15px"}}>Search</Button>
            </div>
          </div>
        </div>
      </div>
    );
  }
